import React  from "react";
import PosteNote from "./PosteNote";
import PosteVote from "./PosteVote";

function PosteList({posts})  {
    return <fragment>
        {posts.map((post) =>
            <PosteNote post={post}></PosteNote>
        )}
        {posts.map((post) =>
            <PosteVote post={post} ></PosteVote>
        )}
    </fragment>
}

export default PosteList
